import Itemdisplay from "../../molecules/Itemdisplay";




const Itemdetail = ({match,mobiledata})=>{
   
    const mobileId = match.params.id;
    console.log(match);
    console.log(mobiledata)
    return (
        <div>
            <h1>itemDetail</h1>
            <Itemdisplay mobileId = {mobileId} mobdata={mobiledata}/>
        </div>
        
    )
}
export default Itemdetail;
